import React from 'react'
import {AppBar,Toolbar,Typography }from '@material-ui/core';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import classes from './Home.css';
import LoginUser from './LoginUser'
import SignUpUser from './SignpUser';
import axios from 'ax'


class Navbar extends React.Component {
    constructor(props){
        super(props)
        this.state={
            tokenId: localStorage.getItem("token")

        }
    }
    componentDidMount() {
        axios.get("http://127.0.0.1:5000/get-user-token", {
            headers: {
                Authorization: "Bearer " + this.state.tokenId,
                'Content-Type': 'application/json'
            }
        })
            .then(response => {
                console.log(response.data)
                this.setState({
                    user_id: response.data.user_id
                })
            })
            .catch((err) => alert(err))

    }
    render(){

        return(
            // if (this.state.)
            <div>
                <div className={classes.root}>
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
            {/* <MenuIcon /> */}
          </IconButton>
          <Typography variant="h3"  style ={{marginLeft:"200px"}} className={classes.title}>
           facebook
          </Typography>
          <LoginUser props={this.props}/>
        </Toolbar>
      </AppBar>
      <div style ={{marginLeft:"800px"}}>
          <SignUpUser />
      </div>
    </div>
            </div>
        )


    }
}
export default Navbar
